import React from "react";

const OrderSuccessful = () => {
  return (
    <div className="order-successful">
      <h1>Order Successful!</h1>
      <p>Thank you for your order. Redirecting to the cart...</p>
    </div>
  );
};

export default OrderSuccessful;
